import Router from 'next/router'
import {Table, Button} from 'antd'
import React, {useEffect, useState} from 'react'

const TableList = ({tolist, setTolist, gotalData, pageParams, onPage}) => {
  const [pageSize, setPageSize] = useState(pageParams.pageSize)

  const columns = [
    {
      title: '街道/乡镇名称',
      dataIndex: 'name',
      key: 'name',
      width: 160,
    },
    {
      title: '信用分',
      dataIndex: 'creditScore',
      key: 'creditScore',
      width: 100,
    },
    {
      title: '信用评级',
      dataIndex: 'creditLevel',
      key: 'creditLevel',
      width: 120,
    },
    {
      title: '更新时间',
      dataIndex: 'updateTime',
      key: 'updateTime',
      width: 150,
    },
    {
      title: '操作',
      dataIndex: 'cz',
      key: 'cz',
      width: 150,
      render: (text, record, index) => {
        return (
          <>
            <Button type="link" onClick={() => onEdit(record)}>
              查看
            </Button>
          </>
        )
      },
    },
  ]
  const onEdit = (record) => {
    let url = `/vitalization/creditScore/streetTown/detail?id=${record.id}&name=${record.name}`
    Router.push(url)
  }
  const onShowSizeChange = (current, pageSize) => {
    console.log(current, pageSize)
    pageParams.pageSize = pageSize
    setPageSize(pageSize)
  }
  const pagination = {
    defaultCurrent: 1,
    total: gotalData.total,
    pageSize: pageSize,
    showQuickJumper: true,
    showSizeChanger: true,
    onShowSizeChange: onShowSizeChange,
    current: pageParams.pageNum,
    showTotal: (total) => {
      return `共 ${total} 条记录`
    },
    onChange: (pageNumber) => {
      pageParams.pageNum = pageNumber
      onPage()
    },
  }
  const onEditStatus = (record) => {
    record.status = !record.status
    setTolist([...tolist])
  }
  return (
    <Table
      rowKey={(record) => record.id}
      columns={columns}
      dataSource={tolist}
      pagination={pagination}
    />
  )
}

export default TableList
